"use strict";for(var acc=document.getElementsByClassName("accordion"),i=0;i<acc.length;i++)acc[i].addEventListener("click",function(){this.classList.toggle("active");var n=this.nextElementSibling;n.style.display=n.style.display==="block"?"none":"block";n.style.maxHeight=n.style.maxHeight?null:n.scrollHeight+"px"});